import axios from 'axios'
import { API } from '../Constants'

export function CheckAuth(name, password) {
  return axios({
    headers: {
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password,
    },
  })
}

export function Rsvp(rsvp, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'rsvp',
    headers: {
      'Authorization': auth,
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
    data: rsvp,
  })
}

export function GetList(auth) {
  return axios({
    method: 'GET',
    baseURL: API + 'getinvites',
    headers: {
      authorization: auth,
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
  })
}

export function AddInvite(invite, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'addinvite',
    headers: {
      authorization: auth,
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
    data: {
      "name":invite,
    },
  })
}

export function AddBlog(blog, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'addblog',
    headers: {
      authorization: auth,
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
    data: blog,
  })
}

export function UpdateBlog(blog, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'updateblog',
    headers: {
      authorization: auth,
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
    data: blog,
  })
}

export function RemovePerson(name, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'removeinvite',
    headers: {
      authorization: auth,
      'x-api-key': 'qRLF5bKBLVm13qNgAk5HbAhnq4pvgY4mjHtr4a00',
    },
    data: name
  })
}
